import React, { Component } from 'react';
import styles from './Order.module.scss';
export class Order extends Component {
  render() {
    return (
      <div className={styles.item}>
        <img className={styles.imgItemModel} src={'./img/' + this.props.item.img} alt={'images'} />
        <h1>{this.props.item.title}</h1>
        {/* <p>Опис товару</p>
        <h2 className={styles.openCharacteristics}>{this.props.item.text}</h2> */}
        <ProductDescription />
        <Characteristics />

        {/* <p>Характеристики</p>
        <h2 className={styles.openCharacteristics}>{this.props.item.characteristics}</h2> */}
        <h3>
          <p>Группа:</p>
          {this.props.item.category}
        </h3>
        <h1>{this.props.item.price}грн.</h1>
      </div>
    );
  }
}

export default Order;
